script: |
  super -f text -I q429.spq | sort > q429.out

inputs:
  - name: q429.spq
    data: |
      SELECT ALL + col1 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT col2 BETWEEN + + col2 * + 27 - + CAST ( NULL AS REAL ) AND - col2;
  - name: tab2

outputs:
  - name: q429.out
    data: |
      51
      67
      77
